DROP TABLE IF EXISTS `SchoolarData`;
CREATE TABLE SchoolarData(
   idSchoolData    INTEGER  NOT NULL AUTO_INCREMENT PRIMARY KEY
  ,Ano             INTEGER  NOT NULL
  ,Pop_0_3         INTEGER  NOT NULL
  ,Pop_4_5         INTEGER  NOT NULL
  ,Mat_Creche_Nun  INTEGER  NOT NULL
  ,Mat_Creche_Per  NUMERIC(6,2) NOT NULL
  ,Mat_Pre_Esc_Nun INTEGER  NOT NULL
  ,Mat_Pre_Esc_Per NUMERIC(6,2) NOT NULL
  ,Cod_Munic       INTEGER  NOT NULL
  ,FOREIGN KEY(Cod_Munic) REFERENCES Municipios(Cod_Munic)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES `SchoolarData` WRITE;
UNLOCK TABLES;
